import React from 'react'
import { useNavigate } from 'react-router-dom';
const NavigationLogout = () => {
    const navigate = useNavigate();
    const currentUser = JSON.parse(localStorage.getItem('currentUser') || '{}');
    const userRole = currentUser.role;

  const handleLogout = () => {
    localStorage.removeItem('jwt');
    localStorage.removeItem('currentUser');
    localStorage.removeItem('role');
    navigate("/");
  };

  const handleDashboard = () => {
    if (userRole === 'ADMIN') {
      navigate('/adminPage');
    } else if (userRole === 'USER') {
      navigate('/userHome');
    } else if (userRole === 'MANAGER') {
      navigate('/manager');
    }
  };

  const handleFeatures = () => {
    navigate("/featureSection");
  };

  const handleHome = () => {
    navigate("/");
  };

  const handleAboutUs = () => {
    navigate("/aboutUs");
  };
  return (
    <div className='nav'>
      <nav className="navbar">
        {/* Left links */}
        <ul className="nav-left">
          <div className="logo">AdvancedToDo</div>
          <li onClick={handleHome}>Home</li>
          <li onClick={handleFeatures}>Features</li>
          <li onClick={handleAboutUs}>About Us</li>
          {userRole && <li onClick={handleDashboard}>Dashboard</li>}
        </ul>

        {/* Right buttons */}
        <div className="nav-right">
              <button className="loginn-btn" onClick={handleLogout}>LOGOUT</button>
        </div>
      </nav>
    </div>
  )
}

export default NavigationLogout
